(function( $ ) {

    /**
     * WebExt Datepicker plugin bindings
     */
    $.fn.webDatepicker = function() {
    
        return this.each(function() {
            
            //standard options
            var options = $(this).data("web-datepicker-options") != undefined ? $(this).data("web-datepicker-options") : {};
            
            // mask format
            var maskformat = $(this).data("web-form-mask") != undefined ? $(this).data("web-form-mask") : "9999-99-99";
            
            // attach datepicker
            $(this).datetimepicker(options).mask( maskformat ).attr('size', maskformat.length );
        });
    }
    
    /**
     * WebExt Bootstrap popover bindings
     */
    $.fn.webErrorPop = function() {
        
        return this.each(function(){
            $(this).popover({
                content      : '<span class="text-danger">' + $(this).data('error') + '</span>',    
                trigger      : 'hover',
                placement    : 'top',
                html         : true,
                container    : 'body'           
            });
        });
        
    };  
    
}( jQuery ));
